## Paga

Kecamatan Paga merupakan bagian dari wilayah Kabupaten Sikka yang terletak di Daratan Pulau Flores.

Berdasarkan posisi geografisnya, Kecamatan Paga memiliki batas-batas
Utara - Kecamatan Tana Wawo;
Selatan - Laut Satu;
Barat - Kabupaten Ende;
Timur - Kecamatan Mego;

Kecamatan Paga pada tahun 2024 terdiri dari 14 kelurahan/desa yang terletak di daratan pulau flores.


